import { combineReducers } from "redux";
import flight from "./flight";
import sanbay from "./sanbay";
import chuyenbay from "./chuyenbay";
import booking from "./booking";

var myReducer =  combineReducers({
    flight,
    sanbay,
    chuyenbay,
    booking
});

export default myReducer;
